INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1352877793, 'Nelson IT', '<part><text size="n">Beraten bei der Planung, insbesondere im Hinblick auf die erforderlichen Genauigkeiten</text><text size="n">.</text></part><part><text size="n">Erstellen eines konzeptionellen Meßprogramms.</text></part><part><text size="n">Festlegen eines für alle Beteiligten verbindlichen Maß-, Bezugs- und Benennungssystems.</text></part><part><text size="n">Erstellen von Meßprogrammen für Bewegungs- und Deformationsmessungen, einschließlich Vorgaben für die Baustelleneinrichtung.</text></part>', 1352889368, 'Nelson IT', 'Vorlage Bauvermessung LPH1', '50a346e10000', '100621', true);
INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1347887564, 'Nelson IT', '<part><text size="n">Durcharbeiten der Ergebnisse der Leistungsphasen 3 und 4 (stufenweise Erarbeitung und Darstellung der Lösung) unter Berücksichtigung städtebaulicher, gestalterischer, funktionaler, technischer, bauphysikalischer,  wirtschaftlicher, energiewirtschaftlicher (z.B. hinsichtlich rationeller Energieverwendung und der Verwendung erneuerbarer Energien) und landschaftsökologischer Anforderungen unter Verwendung der Beiträge anderer an der Planung  fachlich Beteiligter bis zur ausführungsreifen Lösung</text><text size="n">.</text></part><part><text size="n">Zeichnerische Darstellung des Objekts mit allen für die Ausführung notwendigen Einzelangaben, z.B. endgültige, vollständige Ausführungs-, Detail- und Konstruktionszeichnungen im Maßstab 1:50 bis 1:1, bei Freianlagen je  nach Art des Bauvorhabens im Maßstab 1:200 bis 1:50, insbesondere Bepflanzungspläne mit den erforderlichen textlichen Ausführungen</text><text size="n">.</text></part><part><text size="n">Bei raumbildenden Ausbauten: Detaillierte Darstellung der Räume und Raumfolgen im Maßstab 1:25 bis 1:1, mit den erforderlichen textlichen Ausführungen; Materialbestimmung</text><text size="n">.</text></part><part><text size="n">Erarbeiten der Grundlagen für die anderen an der Planung fachlich Beteiligten und Integrierung ihrer Beiträge bis zur ausführungsreifen Lösung.</text></part><part><text size="n">Fortschreiben der Ausführungsplanung während der Objektausführung.</text></part>', 1352888600, 'Nelson IT', 'Vorlage 34/39 Leistungsphase 5', '505721cc0000', '100345', false);
