INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1347886972, 'Nelson IT', '<part><text size="n">Analyse der Grundlagen.</text></part><part><text size="n">Abstimmen der Zielvorstellungen (Randbedingungen, Zielkonflikte)</text><text size="n">.</text></part><part><text size="n">Aufstellen eines planungsbezogenen Zielkatalogs (Programmziele).</text></part><part><text size="n">Erarbeiten eines Planungskonzepts einschließlich Untersuchung der alternativen Lösungsmöglichkeiten nach gleichen Anforderungen mit zeichnerischer Darstellung und Bewertung, zum Beispiel versuchsweise zeichnerische  Darstellungen, Strichskizzen, gegebenenfalls mit erläuternden Angaben</text><text size="n">.</text></part><part align="left"><text size="n">Integrieren der Leistungen anderer an der Planung fachlich Beteiligter.</text></part><part><text size="n">Klären und Erläutern der wesentlichen städtebaulichen, gestalterischen, funktionalen, technischen, bauphysikalischen, wirtschaftlichen, energiewirtschaftlichen (z.B. hinsichtlich rationeller Energieverwendung und der  Verwendung erneuerbarer Energien) und landschaftsökologischen Zusammenhänge, Vorgänge und Bedingungen sowie der Belastung und Empfindlichkeit der betroffenen Ökosysteme</text><text size="n">.</text></part><part><text size="n">Vorverhandlungen mit Behörden und anderen an der Planung fachlich Beteiligten über die Genehmigungsfähigkeit.</text></part><part><text size="n">Bei Freianlagen: Erfassen, Bewerten und Erläutern der ökosystemaren Strukturen und Zusammenhänge, zum Beispiel Boden, Wasser, Klima, Luft, Pflanzen- und Tierwelt, sowie Darstellen der räumlichen und gestalterischen  Konzeption mit erläuternden Angaben, insbesondere zur Geländegestaltung, Biotopverbesserung und -vernetzung, vorhandenen Vegetation, Neupflanzung, Flächenverteilung der Grün-, Verkehrs, Wasser-, Spiel- und Sportflächen; ferner  Klären der Randgestaltung und der Anbindung an die Umgebung</text><text size="n">.</text></part><part><text size="n">Kostenschätzung nach DIN 276 oder nach dem wohnungsrechtlichen Berechnungsrecht</text><text size="n">.</text></part><part><text size="n">Zusammenstellen aller Vorplanungsergebnisse.</text></part>', 1352888576, 'Nelson IT', 'Vorlage 34/39 Leistungsphase 2', '50571f7c0000', '100342', false);
