INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1352111417, 'Nelson IT', '<part><text size="n">Bestandsaufnahme einschließlich voraussehbarer                                       Veränderungen von Natur und Landschaft</text><text size="n">.</text></part><part><text size="n">                                      Erfassen auf Grund vorhandener Unterlagen                                       und örtlicher Erhebungen, insbesondere</text><text size="n">                                   </text></part><itemize><item><part><text size="n">der größeren naturräumlichen Zusammenhänge                                       und siedlungsgeschichtlichen Entwicklungen</text></part></item><item><part><text size="n">des Naturhaushalts</text></part></item><item><part><text size="n">der landschaftsökologischen Einheiten</text></part></item><item><part><text size="n">des Landschaftsbildes</text></part></item><item><part><text size="n">der Schutzgebiete und geschützten Landschaftsbestandteile</text></part></item><item><part><text size="n">der Erholungsgebiete und -flächen, ihrer                                       Erschließung sowie Bedarfssituation</text></part></item><item><part><text size="n">von Kultur-, Bau- und Bodendenkmälern</text></part></item><item><part><text size="n">der Flächennutzung</text></part></item><item><part><text size="n">voraussichtlicher Änderungen auf Grund                                       städtebaulicher Planungen, Fachplanungen                                       und anderer Eingriffe in Natur und                                       Landschaft</text><text size="n">                                      Erfassen von vorliegenden Äußerungen der                                       Einwohner.</text></part></item></itemize><part><text size="n">                                  </text><text size="n">                                  </text></part><part><text size=