INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1386319855, 'Nelson IT', '<itemize><item><part><text size="n">Erarbeiten des Entwurfs auf Grundlage der Vorplanung durch zeichnerische Darstellung im erforderlichen Umfang und Detaillierungsgrad unter Berücksichtigung aller fachspezifischen Anforderungen Bereitstellen der Arbeitsergebnisse als Grundlage für die anderen an der Planung fachlich Beteiligten, sowie Integration und Koordination der Fachplanungen</text></part></item><item><part><text size="n">Erläuterungsbericht unter Verwendung der Beiträge anderer an der Planung fachlich Beteiligter</text></part></item><item><part><text size="n">Fachspezifische Berechnungen ausgenommen Berechnungen aus anderen Leistungsbildern</text></part></item><item><part><text size="n">Ermitteln der zuwendungsfähigen Kosten, Mitwirken beim Aufstellen des Finanzierungsplans sowie Vorbereiten der Anträge auf Finanzierung</text></part></item><item><part><text size="n">Mitwirken beim Erläutern des vorläufigen Entwurfs gegenüber Dritten an bis zu drei Terminen, Überarbeiten des vorläufigen Entwurfs auf Grund von Bedenken und Anregungen</text></part></item><item><part><text size="n">Vorabstimmen der Genehmigungsfähigkeit mit Behörden und anderen an der Planung fachlich Beteiligten</text></part></item><item><part><text size="n">Kostenberechnung einschließlich zugehöriger Mengenermittlung, Vergleich der Kostenberechnung mit der Kostenschätzung</text></part></item><item><part><text size="n">Überschlägige Festlegung der Abmessungen von Ingenieurbauwerken</text></part></item><item><part><text size="n">Ermitteln der Schallimmissionen von der Verkehrsanlage nach Tabellenwerten; Festlegen der erforderlichen Schallschutzmaßnahmen an der Verkehrsanlage, gegebenenfalls unter Einarbeitung der Ergebnisse detaillierter schalltechnischer Untersuchungen und Feststellen der Notwendigkeit von Schallschutzmaßnahmen an be