INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1351500726, 'Nelson IT', '<part><text size="n">Bestandsaufnahme</text><text size="n">.</text></part><part><text size="n">Erfassen und Darlegen der Ziele der Raumordnung und Landesplanung, der beabsichtigten Planungen und Maßnahmen der Gemeinde und der Träger öffentlicher Belange</text><text size="n">.</text></part><part><text size="n">Darstellen des Zustands unter Verwendung hierzu vorliegender Fachbeiträge, insbesondere im Hinblick auf Topographie, vorhandene Bebauung und ihre Nutzung, Freiflächen und ihre Nutzung, Verkehrs-, Ver- und  Entsorgungsanlagen, Umweltverhältnisse, wasserwirtschaftliche Verhältnisse, Lagerstätten, Bevölkerung, gewerbliche Wirtschaft, land- und forstwirtschaftliche Struktur.</text></part><part><text size="n">Darstellen von Flächen, deren Böden erheblich mit umweltgefährdenden Stoffen belastet sind, soweit Angaben hierzu vorliegen.</text></part><part><text size="n">Kleinere Ergänzungen vorhandener Karten nach örtlichen Feststellungen unter Berücksichtigung aller Gegebenheiten, die auf die Planung von Einfluß sind.</text></part><part><text size="n">Beschreiben des Zustands mit statistischen Angaben im Text, in Zahlen sowie zeichnerischen oder graphischen Darstellungen, die den letzen Stand der Entwicklung zeigen.</text></part><part><text size="n">Örtliche Erhebungen.</text></part><part><text size="n">Erfassen von vorliegenden Äußerungen der Einwohner.</text></part><part><text size="n">Analyse des in der Bestandsaufnahme ermittelten und beschriebenen Zustands.</text></part><part><text size="n">Zusammenstellen und Gewichten der vorliegenden Fachprognosen über die voraussichtliche Entwicklung der Bevölkerung, der sozialen und kulturellen Einrichtungen, der gewerblichen Wirtschaft, der Land- und Forstwirtschaft,  des Verkehrs, der Ver- und Entsorgung und des Umweltschutzes in Abstimmung mit dem Auftraggeber sowie unter Berücksichtigung von Auswirkungen übergeordneter Planungen.</text></part><part><text size="n">Mitwirken beim Aufstellen von Zielen und Zwecken der Planung.</text></part>', 1352888341, 'Nelson IT', 'Vorlage 20 Leistungsphase 2', '508e43b60000', '100202', false);
INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1351506066, 'Nelson IT', '<part><text size="n">Ermitteln des Planungsbestands, wie die bestehenden Planungen und Maßnahmen der Gemeinde und der Stellen, die Träger öffentlicher Belange sind</text><text size="n">.</text></part><part><text size="n">Ermitteln des Zustands des Planbereichs, wie Topographie, vorhandene Bebauung und Nutzung, Freiflächen und Nutzung einschließlich Bepflanzungen, Verkehrs-, Ver- und Entsorgungsanlagen, Umweltverhältnisse, Baugrund,  wasserwirtschaftliche Verhältnisse, Denkmalschutz und Milieuwerte, Naturschutz, Baustrukturen, Gewässerflächen, Eigentümer, durch Begehungen, zeichnerische Darstellungen, Beschreibungen unter Verwendung von Beiträgen anderer an  der Planung fachlich Beteiligter. Die Ermittlungen sollen sich auf die Bestandsaufnahme gemäß Flächennutzungsplan und deren Fortschreibung und Ergänzung stützen beziehungsweise darauf aufbauen</text><text size="n">.</text></part><part><text size="n">Darstellen von Flächen, deren Böden erheblich mit umweltgefährdenden Stoffen belastet sind, soweit Angaben hierzu vorliegen</text><text size="n">.</text></part><part><text size="n">Örtliche Erhebungen</text><text size="n">.</text></part><part><text size="n">Erfassen von vorliegenden Äußerungen der Einwohner.</text></part><part><text size="n">Analyse des in der Bestandsaufnahme ermittelten und beschriebenen Zustands.</text></part><part><text size="n">Prognose der voraussichtlichen Entwicklung, insbesondere unter Berücksichtigung von Auswirkungen übergeordneter Planungen unter Verwendung von Beiträgen anderer an der Planung fachlich Beteiligter</text><text size="n">.</text></part><part><text size="n">Mitwirken beim Aufstellen von Zielen und Zwecken der Planung.</text></part>', 1352888391, 'Nelson IT', 'Vorlage 21 Leistungsphase 2', '508e58920000', '100212', false);
INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1352441504, 'Nelson IT', '<part><text size="n">Bestandsaufnahme einschließlich voraussichtlicher                                       Änderungen.</text></part><part><text size="n">                                      Erfassen auf Grund vorhandener Unterlagen                                       eines Landschaftsplans und örtlicher Erhebungen,                                       insbesondere</text></part><itemize><item><part><text size="n">des Naturhaushalts als Wirkungsgefüge                                       der Naturfaktoren</text></part></item><item><part><text size="n">der Vorgaben des Artenschutzes, des Bodenschutzes                                       und des Orts-/Landschaftsbildes</text></part></item><item><part><text size="n">der siedlungsgeschichtlichen Entwicklung</text></part></item><item><part><text size="n">der Schutzgebiete und geschützten Landschaftsbestandteile                                       einschließlich der unter Denkmalschutz stehenden                                       Objekte</text></part></item><item><part><text size="n">der Flächennutzung unter besonderer Berücksichtigung                                       der Flächenversiegelung, Größe, Nutzungsarten                                       oder Ausstattung, Verteilung, Vernetzung                                       von Frei- und Grünflächen sowie der Erschließungsflächen                                       für Freizeit- und Erholungsanlagen</text></part></item><item><part><text size="n">des Bedarfs an Erholungs- und Freizeiteinrichtungen                                       sowie an sonstigen Grünflächen</text></part></item><item><part><text size="n">der voraussichtlichen Änderungen auf Grund                                       städtebaulicher Planungen, Fachplanungen                                       und anderer Eingriffe in Natur und                                       Landschaft</text></part></item><item><part><text size="n">der Immissionen, Boden- und Gewässerbelastungen</text></part></item><item><part><text size="n">der Eigentümer.</text></part></item></itemize><part><text size="n">Erfassen von vorliegenden Äußerungen der                                       Einwohner.</text><text size="n">                                      </text></part><part><text size="n">Bewerten der Landschaft nach den Zielen                                       und Grundsätzen des Naturschutzes und der                                       Landschaftspflege einschließlich der Erholungsvorsorge.</text></part><part><text size="n">                                      Bewerten des Landschaftsbildes sowie der                                       Leistungsfähigkeit, des Zustands, der Faktoren                                       und Funktionen des Naturhaushalts, insbesondere                                       hinsichtlich.</text></part><itemize><item><part><text size="n">der Empfindlichkeit des jeweiligen Ökosystems                                       für bestimmte Nutzungen, seiner Größe, der räumlichen                                       Lage und der Einbindung in Grünflächensysteme,                                       der Beziehungen zum Außenraum sowie                                       der Ausstattung und Beeinträchtigung der                                       Grün- und Freiflächen</text></part></item><item><part><text size="n">nachteiliger Nutzungsauswirkungen.</text></part></item></itemize><part><text size="n">                                      </text><text size="n">Zusammenfassende Darstellung der Bestandsaufnahme                                       und der Bewertung des Planungsbereichs in                                       Erläuterungstext und Karten.</text></part>', 1352888478, 'Nelson IT', 'Vorlage 29 Leistungsphase 2', '509c9ea00000', '100292', false);
INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1352441512, 'Nelson IT', '<part><text size="n">Grundsätzliche Lösung der wesentlichen Teile der Aufgabe mit sich wesentlich unterscheidenden Lösungen nach gleichen Anforderungen in Text und Karten mit Begründung. Darlegen der Flächenfunktionen und räumlichen Strukturen nach ökologischen und gestalterischen Gesichtspunkten, insbesondere</text></part><itemize><item><part><text size="n">Flächen mit Nutzungsbeschränkungen einschließlich notwendiger Nutzungsänderungen zur Erhaltung oder Verbesserung des Naturhaushalts oder des Landschafts-/Ortsbildes</text></part></item><item><part><text size="n">landschaftspflegerische Sanierungsbereiche</text></part></item><item><part><text size="n">Flächen für landschaftspflegerische Entwicklungs- und Gestaltungsmaßnahmen</text></part></item><item><part><text size="n">Flächen für Ausgleichs- und Ersatzmaßnahmen</text></part></item><item><part><text size="n">Schutzgebiete und -objekte, Freiräume</text></part></item><item><part><text size="n"> Flächen für landschaftspflegerische Maßnahmen in Verbindung mit sonstigen Nutzungen.</text></part></item></itemize><part><text size="n">Darlegen von Entwicklungs-, Schutz-, Gestaltungs- und Pflegemaßnahmen, insbesondere für</text></part><itemize><item><part><text size="n">Grünflächen, Anpflanzung und Erhaltung von Grünbeständen</text></part></item><item><part><text size="n">Sport-, Spiel- und Erholungsflächen</text></part></item><item><part><text size="n">Fußwegsysteme</text></part></item><item><part><text size="n"> Gehölzanpflanzungen zur Einbindung baulicher Anlagen in die Umgebung</text><text size="n">    Ortseingänge und Siedlungsränder - pflanzliche Einbindungen von öffentlichen Straßen und Plätzen</text></part></item><item><part><text size="n">klimatisch wichtige Freiflächen, Immissionsschutzmaßnahmen.</text></part></item></itemize><part><text size="n">Festlegen von Pflegemaßnahmen aus Gründen des Naturschutzes und der Landschaftspflege. Erhaltung und Verbesserung der natürlichen Selbstreinigungskraft von Gewässern. Erhaltung und Pflege von naturnahen Vegetationsbeständen. Bodenschützende Maßnahmen - Schutz vor Schadstoffeintrag. Vorschläge für Gehölzarten der potentiell natürlichen Vegetation, für Leitarten bei Bepflanzungen, für Befestigungsarten bei Wohnstraßen, Gehwegen, Plätzen, Parkplätzen, für Versickerungsflächen. Festlegen der zeitlichen Folge von Maßnahmen. Kostenschätzung für durchzuführende Maßnahmen. Hinweise auf weitere Aufgaben von Naturschutz und Landschaftspflege.Vorschläge für Inhalte, die für die Übernahme in andere Planungen, insbesondere in die Bauleitplanung, geeignet sind Beteiligung an der Mitwirkung von Verbänden nach § 29 des Bundesnaturschutzgesetzes.Berücksichtigen von Fachplanungen Mitwirken an der Abstimmung des Vorentwurfs mit der für Naturschutz und Landschaftspflege zuständigen Behörde.</text></part><part><text size="n">Abstimmen des Vorentwurfs mit dem Auftraggeber</text><text size="n">Grundsätzliche Lösung der wesentlichen Teile der Aufgabe mit sich wesentlich unterscheidenden Lösungen nach gleichen Anforderungen in Text und Karten mit Begründung.</text></part><part><text size="n"> </text></part><part><text size="n">                                    </text></part>', 1352888491, 'Nelson IT', 'Vorlage 29 Leistungsphase 3', '509c9ea80000', '100293', false);
INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1347887223, 'Nelson IT', '<part><text size="n">Durcharbeiten des Planungskonzepts (stufenweise Erarbeitung einer zeichnerischen Lösung) unter Berücksichtigung städtebaulicher, gestalterischer, funktionaler, technischer, bauphysikalischer, wirtschaftlicher,  energiewirtschaftlicher (z.B. hinsichtlich rationeller Energieverwendung und der Verwendung erneuerbarer Energien) und landschaftsökologischer Anforderungen unter Verwendung der Beiträge anderer an der Planung fachlich  Beteiligter bis zum vollständigen Entwurf</text><text size="n">.</text></part><part><text size="n">Integrieren der Leistungen anderer an der Planung fachlich Beteiligter</text><text size="n">.</text></part><part><text size="n">Objektbeschreibung mit Erläuterung von Ausgleichs- und Ersatzmaßnahmen nach Maßgabe der naturschutzrechtlichen Eingriffsregelung</text><text size="n">.</text></part><part><text size="n">Zeichnerische Darstellung des Gesamtentwurfs, z.B. durchgearbeitete, vollständige Vorentwurfs- und/oder Entwurfszeichnungen (Maßstab nach Art und Größe des Bauvorhabens; bei Freianlagen im Maßstab 1:500 bis 1:100,  insbesondere mit Angaben zur Verbesserung der Biotopfunktion, zu Vermeidungs-, Schutz-, Pflege- und Entwicklungsmaßnahmen sowie zur differenzierten Bepflanzung; bei raumbildenden Ausbauten: im Maßstab 1:50 bis 1:20,  insbesondere mit Einzelheiten der Wandabwicklungen, Farb-, Licht- und Materialgestaltung), gegebenenfalls auch Detailpläne mehrfach wiederkehrender Raumgruppen; </text><text size="n">Verhandlungen mit Behörden und anderen an der Planung fachlich  Beteiligten über die Genehmigungsfähigkeit</text><text size="n">.</text></part><part><text size="n">Kostenberechnung nach DIN 276 oder nach dem wohnungsrechtlichen Berechnungsrecht</text><text size="n">.</text></part><part><text size="n">Zusammenfassen aller Entwurfsunterlagen.</text></part><part><text size="n">Kostenkontrolle durch Vergleich der Kostenberechnung mit der Kostenschätzung.</text></part>', 1352888587, 'Nelson IT', 'Vorlage 34/39 Leistungsphase 3', '505720770000', '100343', false);
