INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1386319847, 'admindb', '<itemize><item><part><text size="n">Beschaffen und Auswerten amtlicher Karten</text></part></item><item><part><text size="n">Analysieren der Grundlagen</text></part></item><item><part><text size="n">Abstimmen der Zielvorstellungen auf die öffentlich-rechtlichen Randbedingungen sowie Planungen Dritter</text></part></item><item><part><text size="n">Untersuchen von Lösungsmöglichkeiten mit ihren Einflüssen auf bauliche und konstruktive Gestaltung, Zweckmäßigkeit, Wirtschaftlichkeit unter Beachtung der Umweltverträglichkeit</text></part></item><item><part><text size="n">Erarbeiten eines Planungskonzepts einschließlich Untersuchung von bis zu 3 Varianten nach gleichen Anforderungen mit zeichnerischer Darstellung und Bewertung unter Einarbeitung der Beiträge anderer an der Planung fachlich Beteiligter Überschlägige verkehrstechnische Bemessung der Verkehrsanlage, Ermitteln der Schallimmissionen von der Verkehrsanlage an kritischen Stellen nach Tabellenwerten Untersuchen der möglichen Schallschutzmaßnahmen, ausgenommen detaillierte schalltechnische Untersuchungen</text></part></item><item><part><text size="n">Klären und Erläutern der wesentlichen fachspezifischen Zusammenhänge, Vorgänge und Bedingungen</text></part></item><item><part><text size="n">Vorabstimmen mit Behörden und anderen an der Planung fachlich Beteiligten über die Genehmigungsfähigkeit, gegebenenfalls Mitwirken bei Verhandlungen über die Bezuschussung und Kostenbeteiligung</text></part></item><item><part><text size="n">Mitwirken bei Erläutern des Planungskonzepts gegenüber Dritten an bis zu 2 Terminen</text></part></item><item><part><text size="n">Überarbeiten des Planungskonzepts nach Bedenken und Anregungen</text></part></item><item><part><text size="n">Bereitstellen von Unterlagen als Auszüge aus der Voruntersuchung zur Verwendung für ein Raumordnungsverfahren</text></part></item><item><part><text size="n">Kostenschätzung, Vergleich mit den finanziellen Rahmenbedingungen</text></part></item><item><part><text size="n">Zusammenfassen, Erläutern und Dokumentieren</text></part></item></itemize>', 1386598572, 'admindb', 'Vorlage 48 Leistungsphase 2', '52a18fe70000', '200482', false);
