INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1386319883, 'admindb', '<itemize><item><part><text size="n">Einholen von Angeboten</text></part></item><item><part><text size="n">Prüfen und Werten der Angebote, Aufstellen der Preisspiegel</text></part></item><item><part><text size="n">Abstimmen und Zusammenstellen der Leistungen der fachlich Beteiligten, die an der Vergabe mitwirken</text></part></item><item><part><text size="n">Führen von Bietergesprächen</text></part></item><item><part><text size="n">Erstellen der Vergabevorschläge, Dokumentation des Vergabeverfahrens</text></part></item><item><part><text size="n">Zusammenstellen der Vertragsunterlagen</text></part></item><item><part><text size="n">Vergleichen der Ausschreibungsergebnisse mit den vom Planer bepreisten Leistungsverzeichnissen und der Kostenberechnung</text></part></item><item><part><text size="n">Mitwirken bei der Auftragserteilung</text></part></item></itemize><part><text size="n"></text></part>', 1386598982, 'admindb', 'Vorlage 48 Leistungsphase 7', '52a1900b0000', '200487', false);
INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1386319891, 'admindb', '<itemize><item><part><text size="n">Aufsicht über die örtliche Bauüberwachung, Koordinierung der an der Objektüberwachung fachlich Beteiligten, einmaliges Prüfen von Plänen auf Übereinstimmung mit dem auszuführenden Objekt und Mitwirken bei deren Freigabe</text></part></item><item><part><text size="n">Aufstellen, Fortschreiben und Überwachen eines Terminplans (Balkendiagramm)</text></part></item><item><part><text size="n">Veranlassen und Mitwirken daran, die ausführenden Unternehmen in Verzug zu setzen</text></part></item><item><part><text size="n">Kostenfeststellung, Vergleich der Kostenfeststellung mit der Auftragssumme</text></part></item><item><part><text size="n">Abnahme von Bauleistungen, Leistungen und Lieferungen unter Mitwirkung der örtlichen Bauüberwachung und anderer an der Planung und Objektüberwachung fachlich Beteiligter, Feststellen von Mängeln, Fertigen einer Niederschrift über das Ergebnis der Abnahme</text></part></item><item><part><text size="n">Antrag auf behördliche Abnahmen und Teilnahme daran</text></part></item><item><part><text size="n">Überwachen der Prüfungen der Funktionsfähigkeit der Anlagenteile und der Gesamtanlage</text></part></item><item><part><text size="n">Übergabe des Objekts</text></part></item><item><part><text size="n">Auflisten der Verjährungsfristen der Mängelansprüche</text></part></item><item><part><text size="n">Zusammenstellen und Übergeben der Dokumentation des Bauablaufs, der Bestandsunterlagen und der Wartungsvorschriften</text></part></item></itemize>', 1386599043, 'admindb', 'Vorlage 48 Leistungsphase 8', '52a190130000', '200488', false);
INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1386322232, 'admindb', '<itemize><item><part><text size="n">Analysieren der Grundlagen</text></part></item><item><part><text size="n">Beraten in statisch-konstruktiver Hinsicht unter Berücksichtigung der Belange der Standsicherheit, der Gebrauchsfähigkeit und der Wirtschaftlichkeit</text></part></item><item><part><text size="n">Mitwirken bei dem Erarbeiten eines Planungskonzepts einschließlich Untersuchung der Lösungsmöglichkeiten des Tragwerks unter gleichen Objektbedingungen mit skizzenhafter Darstellung, Klärung und Angabe der für das Tragwerk wesentlichen konstruktiven Festlegungen für zum Beispiel Baustoffe, Bauarten und Herstellungsverfahren, Konstruktionsraster und Gründungsart</text></part></item><item><part><text size="n">Mitwirken bei Vorverhandlungen mit Behörden und anderen an der Planung fachlich Beteiligten über die Genehmigungsfähigkeit</text></part></item><item><part><text size="n">Mitwirken bei der Kostenschätzung und bei der Terminplanung</text></part></item><item><part><text size="n">Zusammenfassen, Erläutern und Dokumentieren der Ergebnisse</text></part></item></itemize>', 1386599149, 'admindb', 'Vorlage 52 Leistungsphase 2', '52a199380000', '200522', false);
INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1386322239, 'admindb', '<itemize><item><part><text size="n">Erarbeiten der Tragwerkslösung, unter Beachtung der durch die Objektplanung integrierten Fachplanungen, bis zum konstruktiven Entwurf mit zeichnerischer Darstellung</text></part></item><item><part><text size="n">Überschlägige statische Berechnung und Bemessung</text></part></item><item><part><text size="n">Grundlegende Festlegungen der konstruktiven Details und Hauptabmessungen des Tragwerks für zum Beispiel Gestaltung der tragenden Querschnitte, Aussparungen und Fugen; Ausbildung der Auflager- und Knotenpunkte sowie der Verbindungsmittel</text></part></item><item><part><text size="n">Überschlägiges Ermitteln der Betonstahlmengen im Stahlbetonbau, der Stahlmengen im Stahlbau und der Holzmengen im Ingenieurholzbau</text></part></item><item><part><text size="n">Mitwirken bei der Objektbeschreibung bzw. beim Erläuterungsbericht</text></part></item><item><part><text size="n">Mitwirken bei Verhandlungen mit Behörden und anderen an der Planung fachlich Beteiligten über die Genehmigungsfähigkeit</text></part></item><item><part><text size="n">Mitwirken bei der Kostenberechnung und bei der Terminplanung</text></part></item><item><part><text size="n">Mitwirken beim Vergleich der Kostenberechnung mit der Kostenschätzung</text></part></item><item><part><text size="n">Zusammenfassen, Erläutern und Dokumentieren der Ergebnisse</text></part></item></itemize>', 1386599238, 'admindb', 'Vorlage 52 Leistungsphase 3', '52a1993f0000', '200523', false);
INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1386582961, 'admindb', '<itemize><item><part><text size="n">Erarbeiten der Ausführungsplanung auf Grundlage der Ergebnisse der Leistungsphasen 3 und 4 (stufenweise Erarbeitung und Darstellung der Lösung) unter Beachtung der durch die Objektplanung integrierten Fachplanungen bis zur ausführungsreifen Lösung</text></part></item><item><part><text size="n">Fortschreiben der Berechnungen und Bemessungen zur Auslegung der technischen Anlagen und Anlagenteile Zeichnerische Darstellung der Anlagen in einem mit dem Objektplaner abgestimmten Ausgabemaßstab und Detaillierungsgrad einschließlich Dimensionen (keine Montage- oder Werkstattpläne) Anpassen und Detaillieren der Funktions- und Strangschemata der Anlagen bzw. der GA-Funktionslisten Abstimmen der Ausführungszeichnungen mit dem Objektplaner und den übrigen Fachplanern</text></part></item><item><part><text size="n">Anfertigen von Schlitz- und Durchbruchsplänen</text></part></item><item><part><text size="n">Fortschreibung des Terminplans</text></part></item><item><part><text size="n">Fortschreiben der Ausführungsplanung auf den Stand der Ausschreibungsergebnisse und der dann vorliegenden Ausführungsplanung des Objektplaners, Übergeben der fortgeschriebenen Ausführungsplanung an die ausführenden Unternehmen</text></part></item><item><part><text size="n">Prüfen und Anerkennen der Montage- und Werkstattpläne der ausführenden Unternehmen auf Übereinstimmung mit der Ausführungsplanung</text></part></item></itemize><part><text size="n"></text></part>', 1386599607, 'admindb', 'Vorlage 56 Leistungsphase 5', '52a593b10000', '200565', false);
INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1386582968, 'admindb', '<itemize><item><part><text size="n">Ermitteln von Mengen als Grundlage für das Aufstellen von Leistungsverzeichnissen in Abstimmung mit Beiträgen anderer an der Planung fachlich Beteiligter</text></part></item><item><part><text size="n">Aufstellen der Vergabeunterlagen, insbesondere mit Leistungsverzeichnissen nach Leistungsbereichen, einschließlich der Wartungsleistungen auf Grundlage bestehender Regelwerke</text></part></item><item><part><text size="n">Mitwirken beim Abstimmen der Schnittstellen zu den Leistungsbeschreibungen der anderen an der Planung fachlich Beteiligten</text></part></item><item><part><text size="n">Ermitteln der Kosten auf Grundlage der vom Planer bepreisten Leistungsverzeichnisse</text></part></item><item><part><text size="n">Kostenkontrolle durch Vergleich der vom Planer bepreisten Leistungsverzeichnisse mit der Kostenberechnung</text></part></item><item><part><text size="n">Zusammenstellen der Vergabeunterlagen</text></part></item></itemize>', 1386599647, 'admindb', 'Vorlage 56 Leistungsphase 6', '52a593b80000', '200566', false);
INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1386582975, 'admindb', '<itemize><item><part><text size="n">Einholen von Angeboten</text></part></item><item><part><text size="n">Prüfen und Werten der Angebote, Aufstellen der Preisspiegel nach Einzelpositionen, Prüfen und Werten der Angebote für zusätzliche oder geänderte Leistungen der ausführenden Unternehmen und der Angemessenheit der Preise</text></part></item><item><part><text size="n">Führen von Bietergesprächen</text></part></item><item><part><text size="n">Vergleichen der Ausschreibungsergebnisse mit den vom Planer bepreisten Leistungsverzeichnissen und der Kostenberechnung</text></part></item><item><part><text size="n">Erstellen der Vergabevorschläge, Mitwirken bei der Dokumentation der Vergabeverfahren</text></part></item><item><part><text size="n">Zusammenstellen der Vertragsunterlagen und bei der Auftragserteilung</text></part></item></itemize>', 1386599688, 'admindb', 'Vorlage 56 Leistungsphase 7', '52a593bf0000', '200567', false);
INSERT INTO product (createdate, createuser, description, modifydate, modifyuser, name, productid, productnumber, withworkingstep) VALUES (1386582984, 'admindb', '<itemize><item><part><text size="n">Überwachen der Ausführung des Objekts auf Übereinstimmung mit der öffentlich-rechtlichen Genehmigung oder Zustimmung, den Verträgen mit den ausführenden Unternehmen, den Ausführungsunterlagen, den Montage- und Werkstattplänen, den einschlägigen Vorschriften und den allgemein anerkannten Regeln der Technik</text></part></item><item><part><text size="n">Mitwirken bei der Koordination der am Projekt Beteiligten</text></part></item><item><part><text size="n">Aufstellen, Fortschreiben und Überwachen des Terminplans (Balkendiagramm)</text></part></item><item><part><text size="n">Dokumentation des Bauablaufs (Bautagebuch)</text></part></item><item><part><text size="n">Prüfen und Bewerten der Notwendigkeit geänderter oder zusätzlicher Leistungen der Unternehmer und der Angemessenheit der Preise</text></part></item><item><part><text size="n">Gemeinsames Aufmaß mit den ausführenden Unternehmen</text></part></item><item><part><text size="n">Rechnungsprüfung in rechnerischer und fachlicher Hinsicht mit Prüfen und Bescheinigen des Leistungsstandes anhand nachvollziehbarer Leistungsnachweise</text></part></item><item><part><text size="n">Kostenkontrolle durch Überprüfen der Leistungsabrechnungen der ausführenden Unternehmen im Vergleich zu den Vertragspreisen und dem Kostenanschlag</text></part></item><item><part><text size="n">Kostenfeststellung</text></part></item><item><part><text size="n">Mitwirken bei Leistungs- u. Funktionsprüfungen</text></part></item><item><part><text size="n">fachtechnische Abnahme der Leistungen auf Grundlage der vorgelegten Dokumentation, Erstellung eines Abnahmeprotokolls, Feststellen von Mängeln und Erteilen einer Abnahmeempfehlung</text></part></item><item><part><text size="n">Antrag auf behördliche Abnahmen und Teilnahme daran</text></part></item><item><part><text size="n">Prüfung der übergebenen Revisionsunterlagen auf Vollzähligkeit, Vollständigkeit und stichprobenartige Prüfung auf Übereinstimmung mit dem Stand der Ausführung</text></part></item><item><part><text size="n">Auflisten der Verjährungsfristen der Ansprüche auf Mängelbeseitigung</text></part></item><item><part><text size="n">Überwachen der Beseitigung der bei der Abnahme festgestellten Mängel</text></part></item><item><part><text size="n">Systematische Zusammenstellung der Dokumentation, der zeichnerischen Darstellungen und rechnerischen Ergebnisse des Objekts</text></part></item></itemize><part><text size="n"></text></part>', 1386599800, 'admindb', 'Vorlage 56 Leistungsphase 8', '52a593c80000', '200568', false);
